Hot DOG in the frickin' city. We were able to work out another round of the Artist Almanac! A hybrid calendar & collage fodder resource brought to you by 19 (nineteen this year!) amazing artists. 

They go on sale Dec 5th @ 8 am Eastern. Make sure you're in my newsletter subs to get absolute first notification! (5am pacific i'll probably still be in bed... thank you social media auto schedulers lol) sign up via the link in my insta bio. I will be selling these straight from the @umwowstudio shop

Last year, these sold out in HOURS.
Think gifts & stocking stuffers♡
Use them to jumpstart your daily art practices.
Collect minis from your favorite artists.
Create vision & inspiration boards.
AH!

$24.99 | 2.75 x 3.75

