Tomorrow is The Sharing Season - a hybrid live & pre-recorded workshop hosted by @theuglyartclub. It's only $24 for 3 live artist tutorials + 7 recorded ones. (The live ones will be added to the classroom after they render for a total of 10!)

It's from 11-3 pst tomorrow & it's gonna be awesome. All about handmade gifts & gift giving! 

These easily customisable spoons will be my demo & the best news is you can still sign up! Via the link in my insta bio or in the comments section. Ugly Art Play Dates go up to $34 after the live is over, so even if you can't make it, grab your discount now!

I am joined by TUAC founders @alteredstatesstudio & @southerngals_designs for the live 

